import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import ProjectProposal from "./routes/ProjectProposal";
import CampaignProposal from "./routes/CampaignProposal";
import ContentsOfProjectReview from "./routes/ContentsOfProjectReview";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          {/* <Route  path={'/'} element={<ProjectProposal />}> </Route>
<Route path={"/"} element={<CampaignProposal />} />
*/}
          <Route path={"/save"} element={<ContentsOfProjectReview />} />
          <Route path={"/"} element={<ContentsOfProjectReview />} />
          <Route path={"/saveReview"} element={<ProjectProposal />} />
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
